'''Charles Brandt''' is an American former investigator and writer. He is best known for writing the memoir ''[[I Heard You Paint Houses]]'' that is the basis for the 2019 film ''[[The Irishman]]'', directed by [[Martin Scorsese]] and starring [[Robert De Niro]], [[Al Pacino]] and [[Joe Pesci]].<ref>{{cite web |last=Bell |first=Breanna |url=https://variety.com/2019/film/news/the-irishman-trailer-martin-scorsese-al-pacino-robert-de-niro-1203285418/ |archiveurl=https://web.archive.org/web/20190731144615/https://variety.com/2019/film/news/the-irishman-trailer-martin-scorsese-al-pacino-robert-de-niro-1203285418/ |title=Martin Scorsese's 'The Irishman' Trailer Teams Robert De Niro, Al Pacino and Joe Pesci |website=[[Variety (magazine)|Variety]] |date=July 31, 2019 |accessdate=July 31, 2019 |archivedate=July 31, 2019 |url-status=live}}</ref>

== Books == 
* {{cite book|author=Brandt, Charles|title=The Right to Remain Silent|isbn=978-0370312132|date=1988}}
* {{cite book|author=Brandt, Charles|title=I Heard You Paint Houses|isbn=978-1586422387|date=2004|title-link=I Heard You Paint Houses}}
* {{cite book|author=Brandt, Charles & [[Joseph Pistone|Pistone, Joseph D.]]|title=Donnie Brasco: Unfinished Business |isbn=9780762432288|date=2008}} 
* {{cite book|author=Brandt, Charles|title=We're Going to Win This Thing: The Shocking Frame-up of a Mafia Crime Buster|isbn=978-0425246092|date=2012}}

