'''BLP College, Masaurhi''' also known as '''Brajlal Prasad Yadav College, Masaurhi''' is a degree college in [[Patna district]] of [[Bihar]], [[India]].<ref>{{Cite web|url=https://www.outlookindia.com/education/b-l-p-college-masaurhi/fk65|title=B. L. P. COLLEGE, MASAURHI {{!}} Outlook Education|website=www.outlookindia.com|access-date=2020-04-06}}</ref> It is affiliated with [[Patliputra University]].<ref>{{Cite web|url=http://www.ppup.ac.in/college-lists/4|title=::: PATLIPUTRA UNIVERSITY, PATNA :::|website=www.ppup.ac.in|access-date=2020-04-06}}</ref> The college offers [[senior secondary education]] and [[undergraduate degree]]s in arts, science and conducts some vocational courses.<ref>{{Cite web|url=https://www.way2college.com/colleges/patna/b-l-p-college-masaurhi|title=B.l.p. College, Masaurhi, Patna Admission, Contact, Ranking 2020|website=Way2College|language=en|access-date=2020-04-06}}</ref>

== History ==
[[File:BLP College.jpg|right|350px]] The college was established in 1979 by Brajlal Prasad Yadav. It got affiliation with [[Patliputra University]] in 2018.

== Degrees and courses ==
The college offers the following degrees and courses.

* Senior Secondary
** [[Intermediate of Arts]]
** Intermediate of Science
** Intermediate of Commerce 
* Bachelor's degree
** [[Bachelor of Arts]]
** [[Bachelor of Science]]


