[[File:Josef Jirecek ZlataPraha 1888.png|thumb|right|150px|Josef Jireček (1888)]]
'''Josef Jireček''' (9 October 1825, in [[Vysoké Mýto]] – 25 November 1888, in [[Prague]]) was a [[Czech Republic|Czech]] scholar.

He was born in Vysoké Mýto (then part of the [[Austrian Empire]]).
He entered the Prague bureau of education in 1850, and became minister of the department in the [[Karl Sigmund von Hohenwart|Hohenwart]] cabinet in 1871. His efforts to secure equal educational privileges for the Slav nationalities in the Austrian dominions brought him into disfavour with the German element. He became a member of the Bohemian [[Landtag]] in 1878, and of the Austrian [[Reichsrat (Austria)|Reichsrat]] in 1879. His merits as a scholar were recognized in 1875 by his election as president of the [[Royal Czech Society of Sciences]]. He died in Prague on 25 November 1888.

In 1862, he and his brother [[Hermenegild Jirecek|Hermenegild Jireček]] strove to defend the genuineness of the [[Manuscripts of the Queen's Court and Green Mountain|Königinhof Manuscript]] discovered by [[Václav Hanka]]. He published in the [[Czech language]] an anthology of Czech literature (3&nbsp;volumes, 1858–1861), a biographical dictionary of Czech writers (2&nbsp;volumes, 1875–1876), a Czech hymnology, editions of [[Jan Blahoslav]]'s ''Czech grammar'' and of some Czech classics, and of the works of his father-in-law [[Pavel Josef Safarik]] (1795–1861).

His son was slavist [[Konstantin Josef Jireček]], his brother was historian [[Hermenegild Jireček]].

{{1911|wstitle=Jireček, Josef|volume=15||page=417}}

